INSERT INTO S_PAGE_LIST(LIST_ID, LIST_NAME, LIST_TITLE, LIST_QUERY, PER_PAGE_LIMIT, ITEM_INDEX, SHOW_COUNT, APPLY_FILTER, HAS_WORKGROUP, TEMPLATE_HANDLES_PAGING, DATA_TRANSFORMATION_SCRIPT, DATA_TRANSFORMATION_FUNC_NAME, DATA_TRANSFORMATION_SCRIPT_LANGUAGE, RECORD_RETRIEVE_METHOD, PAGE_ID, PRESENTATION_TEMPLATE_ID, USE_NOLOCK) VALUES(N'e5278d58-ca08-4b09-aa58-d966dd1250f9', N'MAIN', N'', N'dim XMLHeader, XMLInqData, sts, err
dim STYPE
dim SCIFNO, SACCTN, SAFAPN, SAFAAN, SFNAME , XSCREEN
	scb.objSession("errMsg")=""
	XMLHeader = "LN81800"

	STYPE = scb.objRequest.queryString("STYPE")
	XSCREEN = scb.objRequest.queryString("UScreen")
	
	if STYPE = "BC" then
		SCIFNO = scb.objRequest.queryString("SCIFNO")
		if SCIFNO = "" then			
			SCIFNO = scb.objRequest.queryString("SCIFNO")		
		end if
		XMLInqData = "<SCIFNO>"&SCIFNO&"</SCIFNO>"
	elseif STYPE = "AN" then
		SACCTN = scb.objRequest.queryString("SACCTN")
		XMLInqData = "<SACCTN>"&SACCTN&"</SACCTN>"
	elseif STYPE = "FI" then
		SAFAPN = scb.objRequest.queryString("SAFAPN")
		XMLInqData = "<SAFAPN>"&SAFAPN&"</SAFAPN>" 	
	elseif STYPE = "PN" then
		SAFAAN = scb.objRequest.queryString("SAFAAN")
		XMLInqData = "<SAFAAN>"&SAFAAN&"</SAFAAN>" 		
	elseif STYPE = "CN" then
		SFNAME = scb.objRequest.queryString("SFNAME")
		''scb.addJavaScriptLine("alert("""& SFNAME &""")")
		XMLInqData = "<SFNAME>"&SFNAME&"</SFNAME>" 	
	else
		SCIFNO = scb.objRequest.form("SCIFNO")
		if SCIFNO = "" then			
			SCIFNO = scb.objRequest.queryString("SCIFNO")		
		end if
	    XMLInqData = "<SCIFNO>"&SCIFNO&"</SCIFNO>"
	end if
	
	XMLInqData =XMLInqData & "<XSCREEN>"&XSCREEN&"</XSCREEN>"

